import { Component } from 'react';
import Auth from '../components/Auth/Auth';

class App extends Component{
    constructor(){
        super(props)
    }

    render(){
        return (
            <div>
                <Auth/>
                <style jsx global>
                    {`
                        *{
                            padding: 0;
                            margin: 0;
                            border-box: box-sizing;
                        }
                    `}
                </style>
            </div>
        );
    }
}

export default App;
